client_script:
frappe.web_form.after_save = (values) => {
    frappe
        .call({
            method:
                "frappe.core.doctype.data_import.data_import.form_start_import",
            args: { data_import: values.name },
        })
};

custom_css:
.navbar {
    background-color: #022646;
    color: #FFFFFF;
}

.navbar-brand > span {
    color: #FFFFFF !important;
}

.navbar-brand > span:hover {
    color: #FEB32A !important;
}

.nav-link {
    color: #FFFFFF !important;
}

.nav-link:hover {
    color: #FEB32A !important;
}

